import React, { Suspense } from "react"
import ReactDOM from "react-dom"
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"
import * as serviceWorker from "./serviceWorker"
import "mdb-react-ui-kit/dist/css/mdb.min.css"
import "@fortawesome/fontawesome-free/css/all.min.css"
import "./index.css"
import "./libs/css/Animate.min.css"
import "./libs/css/gradientBg.css"

const Manager = React.lazy(() => import("./App"))
const Widget = React.lazy(() => import("./Widget"))

window.wait = async (t = 1) => {
  return new Promise((resolve) => setTimeout(() => resolve, t * 1000))
}

window.imageUrlFixing = (url = "") => {
  return url.replace("p16-sign-va.tiktokcdn.com", "p16-va.tiktokcdn.com")
}

window.randomInt = (min = 10, max = 99) =>
  Math.floor(Math.random() * (max - min + 1) + min)

const Main = () => {
  return (
    <div id="content">
      <h1>Animation &amp; Layers</h1>
      <div class="layer mountain one"></div>
      <div class="layer cloud one">
        <img src="https://anaislab.com/tutoriales/img/cloud1.png" alt="" />
      </div>
      <div class="layer mountain two"></div>
      <div class="layer mountain three"></div>
      <div class="layer cloud two">
        <img src="https://anaislab.com/tutoriales/img/cloud1.png" alt="" />
      </div>
      <div class="layer cloud three">
        <img src="https://anaislab.com/tutoriales/img/cloud1.png" alt="" />
      </div>
    </div>
  )
}

ReactDOM.render(<Main />, document.getElementById("root"))

serviceWorker.unregister()
